REM INSERTING into KING.CUSTOMERSERVICE
SET DEFINE OFF;
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (1,'회원가입은 어떻게 하나요?','회원가입은 홈페이지 우측 상단의 "회원가입" 버튼을 클릭하여 이메일 주소 및 비밀번호를 입력하고 가입 양식을 제출하면 됩니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (1,'비밀번호를 잊어버렸어요. 어떻게 하면 되나요?','로그인 페이지에서 "회원정보찾기"를 클릭하여 정보를 입력해주시면 됩니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (1,'계정을 삭제하려면 어떻게 해야 하나요?','계정 삭제를 원하실 경우 고객 서비스에 문의하여 삭제 절차를 안내받으세요.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (1,'하나의 이메일로 여러 개의 게정을 만들 수 있나요?','아니요, 하나의 이메일로는 하나의 계정만 만들 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (1,'회원 정보를 수정하려면 어디에서 할 수 있나요?','마이페이지에서 개인 정보를 수정할 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (2,'경기 매칭은 어떻게 이루어지나요?','"매칭 찾기"에서 원하는 지역과 시간을 선택하신 후 원하는 경기를 선택하시면 매칭할 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (2,'매칭 조건을 변경할 수 있나요?','"매칭 찾기"에서 원하는 지역과 시간을 선택하여 원하는 매칭 조건을 찾으실 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (2,'매칭 결과를 어떻게 확인할 수 있나요?','마이페이지에서 해당 경기 결과와 세부적인 통계, 랭킹 자료를 확인하실 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (2,'이미 매칭된 상대방과의 경기를 취소할 수 있나요?','네, 매칭된 경기는 매칭 확인 페이지에서 취소할 수 있습니다. 다만, 취소 시 상대방에게 사정 통지하는 것을 권유드립니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (2,'경기를 마친 후기를 작성할 수 있나요?','경기를 마친 후에는 매칭을 신청한 대표자가 경기 후기를 작성할 수 있습니다. 이를 통해 상대팀은 물론 용병의 평가를 할 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (3,'예약은 어떻게 하나요?','예약을 하려면 먼저 웹페이지에 가입한 뒤, 로그인 해야 합니다. 다음 사용 가능한 날짜와 시간을 확인하여 원하는 날짜와 시간을 선택한 후 예약을 완료하세요.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (3,'예약이 정상적으로 완료되었는지 어떻게 확인할 수 있나요?','예약이 완료되면 마이페이지에서 예약 내역을 확인할 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (3,'예약을 변경하려면 어떻게 해야 하나요?','예약을 변경하려면 로그인 한 후 예약 목록에서 해당 예약을 선택하여 변경 요청을 제출하세요. 변경 가능한 날짜와 시간을 확인한 후 변경이 완료됩니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (3,'예약을 취소하려면 어떻게 해야 하나요?','예약 취소 정책은 경기 예약 상황과 시간에 따라 다를 수 있습니다. 자세한 내용은 고객 서비스에 문의해주세요.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (4,'서비스 이용 중 문제가 발생했어요. 어떻게 해결하죠?','문제가 발생했을 때는 고객 지원팀에 문의하여 신속하고 정확한 도움을 받을 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (4,'새로운 기능을 기능을 제안하고 싶어요. 어디에 의견을 보내면 되나요?','고객 의견은 저희에게 매우 소중합니다. 이메일이나 SNS를 통해 의견을 보내실 수 있습니다. 제안된 기능은 우선적으로 검토되고, 적절하다고 판단될 경우 서비스에 반영될 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (4,'새로운 업데이트나 기능 개선이 있을 때 어떻게 알 수 있나요?','새로운 업데이트나 기능 개선에 대한 소식은 공식 웹사이트 공지사항을 통해 확인하실 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (4,'서비스를 더 잘 활용하기 위한 자료는 어디에서 확인할 수 있나요?','추후 사용자들이 서비스를 더 효과적으로 활용할 수 있도록 다양한 자료를 추가할 예정입니다. 많은 관심 부탁드립니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (5,'서비스 이용에 관한 약관은 어디에서 확인할 수 있나요?','서비스 이용에 관한 약관은 로그인 또는 회원가입 시 동의하셔야 합니다. 약관은 웹사이트의 이용 약관 페이지에서 언제든지 확인하실 수 있습니다.');
Insert into KING.CUSTOMERSERVICE (CUSTOMERSERVICE_CATEGORYNO,CUSTOMERSERVICE_SUBJECT,CUSTOMERSERVICE_CONTENT) values (5,'서비스와 소셜 미디어 계정을 연동할 수 있나요?','편리한 로그인 및 공유를 위해 추후 소셜 미디어 계정과 연동할 수 있는 서비스를 제공하고자 준비하고 있습니다.');
