Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (9,'남양주시민 김성일 감독 “팬들과 소통하는 팀 만들겠다”',2,'올해 창단한 남양주시민축구단(이하 남양주)의 초대 감독인 김성일 감독이 세운 목표는 팀을 팬들과 소통하는 클럽으로 만드는 것이다.

 

19일 남양주종합운동장에서 열린 2024 K4리그 9라운드에서 남양주가 당진에 4-2 완승을 거뒀다. 전반 20분 한정우의 골로 앞서간 남양주는 후반전 돌입 후 이종열, 노윤상, 신상휘가 한 골씩 보태 두 골 만회한 당진을 꺾고 승점 3점을 확보했다. 이로써 창단 두 번째 승리를 기록한 남양주(2승 2무 4패, 승점 8점)는 리그 9위에 오르며 중위권 도약의 발판을 마련했다.

 

경기 후 대한축구협회(KFA) 홈페이지와의 인터뷰에 응한 김성일 감독은 “창단 첫 해인 만큼 남양주시에서도 팀에 많은 관심을 가져준다. 덕분에 큰 힘을 받고 있고, 그저 90분 동안 열심히 뛰어준 선수들에게 고맙다”는 소감을 전했다.',to_date('24/05/04','RR/MM/DD'),12);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (10,'여자 U-14 대표팀, 2024 한일교류전 참가',2,'여자 U-14 대표팀이 한일교류전을 통해 경쟁력을 강화한다.

 

이번 한일교류전은 6월 3일부터 7일까지 일본 오사카에서 열린다. 여자 U-14 대표팀은 5월 29일부터 6월 1일까지 창원축구센터에서 국내훈련을 소화한 뒤 6월 3일 일본으로 출국한다.

 

한일교류전 소집명단은 20명으로 구성됐다. 이 중 19명이 2010년생이며, 임지혜(울산현대청운중)가 유일한 2011년생이다. 대한축구협회(KFA) 이다영 전임지도자, 허정재 전임지도자, 문소리 전임지도자가 이번 일정 동안 여자 U-14 대표팀을 이끈다.

 

여자 U-14 대표팀은 일본 여자 U-14 대표팀과 두 차례 교류전을 치른다. 경기는 각각 6월 4일과 6일 오사카의 제이-그린 사카이(J-Green Sakai)에서 열린다. 

 

한일교류전은 양국의 우수 청소년 선수들이 경쟁을 통한 경기력 향상과 상호 교류 증진을 목적으로 진행된다. 대한체육회가 주관하고 문화체육관광부, 국민체육진흥공단의 재정후원을 통해 이뤄진다',to_date('24/05/04','RR/MM/DD'),36);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (11,'축구국가대표팀 신규 마스코트 백호&프렌즈 공개',2,'대한축구협회가 22일 축구국가대표팀의 새로운 마스코트 ‘백호&프렌즈’를 공개했다.

 

백호&프렌즈는 ‘백호’, ‘진두’, ‘티키’, ‘타카’, ‘휘’까지 총 5종의 캐릭터로 구성됐다. 각각의 캐릭터는 스트라이커부터 멀티플레이어, 미드필더, 수비수, 골키퍼까지 서로 다른 포지션을 가지고 있다. 캐릭터 디자인은 백호, 진돗개, 반달가슴곰 등 팬들이 친숙하게 받아들일 수 있는 다양한 동물을 모티브로 했다.',to_date('24/05/11','RR/MM/DD'),30);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (21,'패스마터 가입완료!',14,'CODING247 화이팅!',to_date('24/05/22','RR/MM/DD'),31);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (17,'이동준-장종필 심판, K리그 300경기 출전',2,'이동준(41), 장종필(35) 심판이 K리그 300경기에 출전했다.  

이동준 주심은 지난 5일 수원종합운동장에서 열린 수원FC : 강원FC 경기에 주심으로 나서 K리그 통산 300경기 출전의 대기록을 작성했다.  지난 2008년 K리그 심판으로 데뷔해 올해로 17년차를 맞는 이동준 심판은 이로써 은퇴한 이상용 심판의 358경기에 이어 K리그 주심 역대 최다 출전 랭킹 2위에 오르게 됐다. 

장종필 부심은 지난 15일 광양에서 있었던 전남 드래곤즈 : 성남FC 경기를 통해 K리그 통산 300경기 출전을 기록했다.  2015년부터 K리그 심판으로 활동중인 장종필 부심은 현재 국제심판으로도 활약중이다.  

두 심판은 300경기 출전을 맞아 해당 경기 시작에 앞서 대한축구협회로부터 기념패를 받았다.  두 심판은 경기후 대한축구협회 홈페이지를 통해 간단히 소감을 밝혔다. ',to_date('24/05/22','RR/MM/DD'),9);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (18,'6월 싱가포르, 중국전 임시 감독 체제로 - 김도훈 선',2,'대한축구협회는 오는 6월 열리는 북중미 월드컵 아시아 2차예선 두 경기를 임시 감독 체제로 치르기로 하고, 임시 사령탑에 김도훈(54) 전 울산HD 감독을 선임했다고 20일 발표했다. 대표팀은 6월 6일 싱가포르 원정경기에 이어, 11일 중국과 홈경기를 앞두고 있다. 

 

대한축구협회는 “국가대표팀 감독 선정을 위한 협상이 계속 진행되고 있어 6월 A매치 전까지 감독 선임이 마무리 되지 않을 가능성이 있다. 이 경우를 대비해 오늘(20일) 오전 국가대표 전력강화위원를 열어 이 문제를 논의했고, 그 결과 6월 두 경기를 맡을 임시 감독으로 김도훈 감독을 선임하기로 의견을 모았다”고 밝혔다.

 

선수 시절 스트라이커로 활약했던 김도훈 감독은 2005년 성남일화 코치를 시작으로 인천 유나이티드와 울산HD의 감독을 맡았고, 2021년부터 1년 여 라이언 시티(싱가포르)에서 지휘봉을 잡았다. 특히 2020년 울산HD를 AFC챔피언스리그 우승으로 이끌면서 지도력을 인정받았다. ',to_date('24/05/22','RR/MM/DD'),9);
