Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (26,'프로축구 인천, 울산과 고 유상철 명예감독 3주기 추모',28,'프로축구 인천 유나이티드가 울산과의 홈 경기에서 고(故) 유상철 명예감독의 3주기를 함께 기립니다.

인천은 "내일(29일) 인천축구전용경기장에서 열리는 하나은행 K리그1 2024 15라운드 홈 경기에서 울산과 함께 유 명예감독의 3주기를 맞을 것"이라고 밝혔습니다.

