Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (28,'맨유 시즌 ''최악의 FW'', 정신 차렸나…''SNS 전격 탈퇴''→축구 올인',53,'맨체스터 유나이티드의 공격수 마커스 래시퍼드가 SNS를 잠정 중단할 생각이다. 팬들의 비판을 견디기 힘들었던 모양이다.

영국 매체 ''더선''은 28일(한국시간) "마커스 래시퍼드는 힘든 시즌을 보낸 후 몇 주 동안 SNS 활동을 중단할 것이라고 발표했다"며 "맨유 공격수는 ''X(옛 트위터)''의 게시물을 통해 자신의 결정을 공개했다"고 전했다.',to_date('24/05/28','RR/MM/DD'),0);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (29,'제17회 양구 국토정중앙기 춘계전국대학동아리축구대회 결승전 시상식',82,'제17회 양구 국토정중앙기 춘계전국대학동아리축구대회 결승전 시상식이 28일 종합운동장에서 열렸다. 이번 대회에서 서울시립대가 우승을 차지하고, 고려대가 준우승을 했다.',to_date('24/05/28','RR/MM/DD'),1);
Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (30,'카포 풋볼스토어 석촌점 같이 가실 분',23,'지나가면서 몇 번 봤는데 용품 다양하고 좋은 거 많더라고요.
