Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (31,'"싸우자는 겁니까"…프로축구연맹, 이정효 광주 감독 경위서 요청',56,'한국프로축구연맹이 28일 프로축구 K리그1 광주FC 구단에 이정효 광주 감독 기자회견 논란과 관련한 경위서를 요청했다.

