Insert into KING.FREEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (34,'2026 월드컵 손흥민 출전가능성',44,'사실상 나이도 있고 윙어라는 포지션 때문에 에이징 커브가 올 법도 한데
