Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (49,'6월 월드컵 2차 예선 국가대표팀 코치진 확정','관리자','대한축구협회는 6월 열리는 2026 북중미 월드컵 2차 예선 싱가포르, 중국과의 경기에서 김도훈 임시 감독을 보좌할 대표팀 코치진을 21일 확정, 발표했다.',to_date('24/05/28','RR/MM/DD'),0);
Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (47,'6월 소집 명단 발표 --- 오세훈, 배준호, 황재원 ','관리자','대한축구협회(KFA)가 2026 FIFA 북중미 월드컵 아시아 2차 예선 두 경기에 나설 6월 A대표팀 선수 소집 명단(23명)을 27일 발표했다.
 

아직 정식감독이 선임되지 않아 김도훈 임시 감독 체제로 운영되는 이번 소집에는 손흥민, 이강인, 이재성 등 기존 주축 멤버들이 변함없이 이름을 올린 가운데 오세훈, 배준호, 황재원, 최준 등 연령별 대표팀에서 활약해온 젊은 선수들과 황인재, 박승욱, 하창래 등 연령별 국가대표 경력이 없는 선수까지 총 7명이 A대표팀에 최초 발탁 됐다.',to_date('24/05/28','RR/MM/DD'),0);
Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (48,'월드컵예선 중국전 티켓 판매 29일부터','관리자','대한축구협회가 북중미 월드컵 아시아 2차 예선 중국과의 홈경기 티켓을 29일부터 순차적으로 판매한다. 경기는 6월 11일 화요일 저녁 8시 서울월드컵경기장에서 열린다.

 

티켓은 PlayKFA(링크예정)에 접속해 구입할 수 있다. ‘하나원큐석’에 해당하는 일부 좌석은 하나은행 모바일 어플리케이션 하나원큐에서도 살 수 있다.

 

29일에는 PlayKFA의 VIP 회원들을 대상으로 한 선예매와 스카이박스 예매가 시작된다. VIP 회원중 ‘더 레드’ 등급 회원은 29일 오후 7시부터, ‘블랙’ 등급 회원은 오후 8시부터 구입할 수 있다. 선예매는 1인당 2매씩 구매가 가능하고, 추후 일반 예매에서 추가로 2장을 더 살 수 있다. ',to_date('24/05/28','RR/MM/DD'),0);
Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (50,'[전술분석] 알고도 못 막는 한국의 득점 패턴','관리자','“운동장에서 일어난 일은 운동장에서 풀어야 한다.” 

3월 A대표팀 임시 사령탑을 맡은 황선홍 감독은 2026 북중미 월드컵 아시아지역 2차 예선 C조 3, 4차전에 나설 대표팀 명단을 발표하는 자리에서 이같이 말했다. 태국과의 2연전은 운동장에서의 해법을 모두 보여준 경기들이었다. 



C조 3차전 / 대한민국 1-1 태국(3월 21일) @서울월드컵경기장

경기 분석을 위해 현장을 찾았다. 오랜만에 국내에서 열리는 A매치여서인지 팬들의 관심이 뜨거웠다. 킥오프 세 시간 전부터 경기장으로 몰려든 사람들과 차량들을 보면서 열기를 실감했다. 과거에 비해 20대 여성 팬과 커플 팬이 눈에 띄게 늘었다. 축구장이 새로운 문화를 만드는 장소로 자리잡고 있다는 사실을 확인할 수 있었다. 실제 이날 경기장에입장한 관중수는 64,912명이었다. 축구인의 한 사람으로, 2023 아시안컵에서 기대에 미치지 못하는 경기력과 성적으로 실망한 팬들에게 속죄하는 경기가 되길 바랐다. ',to_date('24/05/28','RR/MM/DD'),1);
Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (51,'‘K4 영플레이어 출신’ 파주 성정윤 “올해는 도움왕 ','관리자','2020 K4리그 영플레이어상 수상자인 파주시민축구단(이하 파주시민) 성정윤은 올해 K3리그 도움왕을 노리고 있다.

 

25일 파주스타디움에서 열린 2024 K3리그 11라운드에서 파주시민이 전반 43분에 터진 상대 자책골에 힘입어 여주FC에 1-0 승리를 거뒀다. 이번 승리로 최근 5경기에서 무패를 기록하게 된 파주시민(4승 3무 3패, 승점 15점)은 다른 팀들보다 한 경기 덜 치른 채 리그 8위에 올랐다. ',to_date('24/05/28','RR/MM/DD'),1);
Insert into KING.NOTICEBOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (52,'파주 오범석 감독 “선수 시절 훈련법, 팀에 주입중" ','관리자','지도자로서 첫 해를 보내고 있는 파주시민축구단(이하 파주시민) 오범석 감독은 선수 시절 프로무대에서 경험한 훈련법을 팀에 주입시켜 선수들을 성장시키려 한다.

 

25일 파주스타디움에서 열린 2024 K3리그 11라운드에서 파주시민이 전반 43분에 터진 상대 자책골에 힘입어 여주FC에 1-0 승리를 거뒀다. 이번 승리로 최근 5경기에서 무패를 기록하게 된 파주시민(4승 3무 3패, 승점 15점)은 다른 팀들보다 한 경기 덜 치른 채 리그 8위에 올랐다. ',to_date('24/05/28','RR/MM/DD'),5);
