Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (26,'QnA 게시판 수정 확인',2,'QnA 게시판 수정 확인aaaaa',to_date('24/05/21','RR/MM/DD'),27);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (2,'팀원을 모집하려는데 어떻게 해야 하나요?',2,'팀을 모집하려고 합니다. 어떤 정보를 게시해야 하며, 어떤 사람들을 찾아야 할 지에 대한 조언이 필요합니다.',to_date('24/05/01','RR/MM/DD'),5);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (3,'매치 예정일 변경이 가능한가요?',3,'예정된 매치 날짜를 변경하고 싶습니다. 어떻게 변경할 수 있을까요? 변경 시 주의할 점이 있나요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (4,'매치 참가 시 필요한 준비물은 무엇인가요?',4,'매치에 참가하기 위해 필요한 준비물에 대해 궁금합니다. 어떤 장비나 용품이 필요한지 알려주세요.',to_date('24/05/01','RR/MM/DD'),7);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (5,'매치 참가 신청 후에는 어떤 절차가 따르나요?',5,'매치에 참가하고 싶어서 신청했는데, 이후에는 어떤 절차가 있는지 궁금합니다. 확인해야 할 사항이 있을까요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (6,'매치 취소 시 환불 정책에 대해 알려주세요.',6,'예약한 매치를 취소해야 할 상황이 발생했습니다. 취소 시 환불 절차와 정책을 알려주세요.',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (7,'매치 참가 시 주의해야 할 안전사항이 있나요?',7,'매치 참가 시에 주의해야 할 안전사항이 있는지 궁금합니다. 부상 예방을 위한 조언이 필요합니다.',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (8,'매치 결과 및 순위에 대한 정보를 어디서 확인할 수 있나요?',8,'참가한 매치의 결과와 순위를 확인하고 싶습니다. 이 정보는 어디에서 확인할 수 있을까요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (9,'매치 장소나 시간을 재확인하고 싶습니다.',9,'매치의 장소나 시간에 대해 다시 확인하고 싶습니다. 확인할 수 있는 방법이 있을까요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (10,'팀에 가입하려면 어떻게 해야 하나요?',10,'팀에 가입하고 싶은데, 가입 방법과 절차에 대해 궁금합니다. 어떻게 해야 하나요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (11,'매치 참가를 위해 필요한 연령 제한이 있나요?',11,'매치에 참가하기 위해선 특정 연령 이상이거나 이하이어야 하는지 궁금합니다. 연령 제한이 있을 경우에는 어떻게 확인하나요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (12,'매치 참가 시 신분증을 지참해야 하나요?',12,'매치에 참가할 때 신분증을 지참해야 하는지 궁금합니다. 신분증을 가져가는 것이 필수 조건인가요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (13,'매치 참가 시 개인 장비를 대여할 수 있나요?',13,'개인적으로 필요한 장비를 가지고 있지 않은데, 매치 참가 시에 장비를 대여할 수 있는지 궁금합니다.',to_date('24/05/01','RR/MM/DD'),2);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (14,'매치 참가 시에는 어떤 드레스 코드를 준수해야 하나요?',14,'매치 참가 시에는 특정한 드레스 코드를 따라야 하는지 궁금합니다. 별도의 의상이 필요한가요?',to_date('24/05/01','RR/MM/DD'),1);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (15,'매치 참가 시에 음주는 허용되나요?',15,'매치 참가 전 후에 음주가 허용되는지 알고 싶습니다. 안전과 질서를 위한 규정이 있나요?',to_date('24/05/01','RR/MM/DD'),0);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (16,'매치 참가 시에 가족이나 친구를 동반할 수 있나요?',16,'매치 참가 시에 동반인을 함께 가지고 갈 수 있는지 궁금합니다. 관련 규정이 있을까요?',to_date('24/05/01','RR/MM/DD'),2);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (17,'매치 중에 부상 시 응급 처치가 가능한가요?',17,'매치 중에 부상이 발생할 경우 응급 처치가 가능한지 궁금합니다. 응급 상황에 대비되어 있나요?',to_date('24/05/01','RR/MM/DD'),4);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (18,'매치 참가를 취소하려면 어디에 문의해야 하나요?',18,'매치 참가를 취소하고 싶은데, 어디에 연락하거나 문의해야 할 지 궁금합니다.',to_date('24/05/01','RR/MM/DD'),4);
Insert into KING.QNABOARD (B_NO,SUBJECT,WRITER,CONTENT,REG_DATE,READCOUNT) values (19,'매치 참가 후에는 어떤 후속 조치가 필요한가요?',19,'매치에 참가한 후에는 추가적인 조치나 절차가 필요한지 궁금합니다. 경기 이후에 해야 할 일이 있을까요?',to_date('24/05/01','RR/MM/DD'),9);
